import style from './Second.module.css'
class Second extends Component {
  render() {
    return (
      <div id={style.second}>
        <div><img src="https://rukminim1.flixcart.com/flap/128/128/image/f15c02bfeb02d15d.png?q=100"></img><p>Top Offers</p></div>
