        <div><img src="https://rukminim1.flixcart.com/flap/128/128/image/22fddf3c7da4c4f4.png?q=100"></img><p>Mobiles</p></div>
        <div><img src="https://rukminim1.flixcart.com/flap/128/128/image/c12afc017e6f24cb.png?q=100"></img><p>Fashion</p></div>
        <div><img src="https://rukminim1.flixcart.com/flap/128/128/image/69c6589653afdb9a.png?q=100"></img><p>Electronics</p></div>
        <div><img src="https://rukminim1.flixcart.com/flap/128/128/image/ab7e2b022a4587dd.jpg?q=100"></img><p>Home</p></div>
        <div><img src="https://rukminim1.flixcart.com/flap/128/128/image/0ff199d1bd27eb98.png?q=100"></img><p>Appliances</p></div>
        <div><img src=""></img><p></p></div>
        <div><img src=""></img><p></p></div>
      </div>
    )
  }
}

export default Second
